// CustomNode.js
import React from 'react';

const CustomNode = ({ data, openModal }) => {
  return (
    <div className="custom-node">
      <div className="node-header">
        {data.label}
      </div>
      <div className="node-footer">
        <button onClick={openModal}>+ Add Task</button>
      </div>
    </div>
  );
};

export default CustomNode;
